            "sentence":"The system itself was challenged by usurper s , and became obsolete with the Phanariote epoch , when rulers were appointed by the Ottoman Sultans ; between 1821 and 1878 ( the date of Romania 's independence ) , various systems combining election and appointment were put in practice . Wallachian rulers , like the Moldavian rulers , bore the titles of `` Voivode '' ( `` duke '' ) or\/and Hospodar ( `` lord , master '' ) ; when writing in Romanian , the term Domn ( from the Latin `` dominus `` ) was used . Most rulers did not use the form of the name they are cited with , and several used more than one form of their own name ; in some cases , the ruler was only mentioned in foreign sources .",
